import React from 'react';
import logo from './logo.svg'; // Importa la imagen de React
import { Navbar, Container, Nav, Button } from 'react-bootstrap'; // Importa componentes de Bootstrap

function Header() {
  return (
    <Navbar bg="dark" variant="dark" fixed="top">
      <Container>
        <Navbar.Brand href="#home">
          <img
            alt="React Logo"
            src={logo}
            width="30"
            height="30"
            className="d-inline-block align-top"
          />{' '}
          React
        </Navbar.Brand>
        <Nav className="ml-auto">
          <Button variant="outline-light">Botón 1</Button>
          <Button variant="outline-light">Botón 2</Button>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default Header;
